import cat from "./cat.jpeg";
import fb from "./fb_logo.png";
import logo from "./logo.svg";

const Contact1 = () =>
{
    return(<div className="contact-card">
    <img src={cat}/>
    <h3>Mr. Whiskerson</h3>
    <div className="info-group">
        <img src={fb} />
        <p>(212) 555-1234</p>
    </div>
    <div className="info-group">
        <img src={logo} />
        <p>mr.whiskaz@catnap.meow</p>
    </div>
</div>
)
}

export default Contact1;
